import React from "react";
import s from './Dialogs.module.css';

function Dialogs() {
    return (
        <div className={s.content}>
            <div className={s.dialogs}>
                <h1>Dialogs</h1>
                <h2>Yaroslav</h2>
                <h2>Alex</h2>
                <h2>Veronika</h2>
                <h2>Naruto</h2>
                <h2>Tanjiro</h2>
                <h2>Yudzhiro</h2>
            </div>
            <div className={s.messages}>
                Hello
                hello
            </div>
        </div>
    )
}

export default Dialogs;
